import logo from './logo.svg';
import './App.css';
import Loginpage from './pages/Loginpage.jsx';
import Homepage from './pages/Homepage.jsx';



function App() {
  return (
    <>
      <h1 className='text-6xl text-red-500'>Hello world</h1>
      
      <Loginpage></Loginpage>
      <Homepage></Homepage>
    </>
  );
}

export default App;
